import { faCheckCircle } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import classNames from "classnames/bind";
import styles from "./AccountItem.module.scss" ;

const cx = classNames.bind(styles) 

function AccountItem() {
    return ( 
        <div className={cx('wrapper')}>
            <img className={cx('avarta')} 
                src="https://p16-sign-sg.tiktokcdn.com/aweme/100x100/tos-alisg-avt-0068/78a57708c273482c65e3105230c4ece9.jpeg?x-expires=1670079600&x-signature=qn05JToW%2Ffu3CNjKx8QasVfNcOE%3D" 
                alt="st" 
            />
            <div className={cx('info')}>
                <h4 className={cx('name')}>
                    <span >Nguyen Van A</span>
                    <FontAwesomeIcon className={cx('check')} icon={faCheckCircle} />
                </h4>
                <span className={cx('username')}>nguyanvana</span>
            </div>

        </div>
    );
}

export default AccountItem
